\parbox{4in}{As $k$ gets very large, the spring approaches being a roller; 
$k/(kL^3+48EI) \rightarrow 1/L^3$
and $R_b\rightarrow P$. This is correct; all the 
load gets transferred to the roller
and vertical displacement is 0 -- 
therefore no bending in the beams, therefore no end reactions.}

\parbox{4in}{When $k=0$, $k/(kL^3+48EI)=0$ and therefore $R_b=0$. 
This is also
correct as this is equivalent to no spring at all, therefore no reaction.}
